                    </NavItem>
                    <NavItem className="mr-2">
                      <Link
                        activeClass="active"
                        to="exploreSection"
                        spy={true}
                        smooth={true}
                        offset={-70}
                        duration={500}
                        >
                        Explore
                      </Link>
                    </NavItem>
                    <NavItem className="mr-2">
                      <Link
                        activeClass="active"
                        to="createSection"
                        spy={true}
                        smooth={true}
                        offset={-70}
                        duration={500}
                      >
                      Create
                    </Link>
                  </NavItem>
                  <NavItem className="mr-2">
                        <Link
                      activeClass="active"
                      to="shareSection"
                      spy={true}
                      smooth={true}
                      offset={-70}
                      duration={500}
                    >
                      Share
                    </Link>
                  </NavItem>
                </Nav>
              </Collapse>
            </Navbar>
          </div>
